import React from 'react';
import Displaydata from './display.json';
import Pagenotfound from './Pagenotfound';

const Display=(props)=> 
{

    const resultdata=(i)=>
    {       

        let { id, name, pic }=Displaydata[i]

        return(<>
                <img src={ pic }  className="w-100" style={{ height:'600px' }} />
            </>); 
    
    }


    switch(props.match.params.name) 
    {
        case '1st pic': return(<> {resultdata(0)} </>); break;
        case '2nd pic': return(<> {resultdata(1)} </>); break;
        case '3rd pic': return(<> {resultdata(2)} </>); break;
        case '4th pic': return(<> {resultdata(3)} </>); break;
        default: return(<Pagenotfound />); break;
    }

}

export default Display;
